import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for and click on a category to get to product listing page
    await page.waitForSelector('.category-card', { timeout: 5000 });
    await page.click('.category-card:first-child');

    // Wait for view toggle buttons to appear
    await page.waitForSelector('.view-toggle', { timeout: 5000 });

    // Check current view mode and switch to list view if needed
    const listViewButton = await page.$('button.view-btn[title="List View"]');
    const isListViewActive = await listViewButton.evaluate(btn => btn.classList.contains('active'));

    if (!isListViewActive) {
      await listViewButton.click();
      await page.waitForSelector('button.view-btn.active[title="List View"]', { timeout: 5000 });
    }

    // Verify we're in list view mode by checking for list view specific elements
    await page.waitForSelector('.products-list', { timeout: 5000 });

    // Take screenshot after switching to list view
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_list_view.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_list_view.png'));

    return {
      success: true,
      action: "Switched to list view mode successfully",
      extractedData: {
        viewMode: "list",
        productCount: await page.$$eval('.product-card-list', elements => elements.length)
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to switch to list view mode",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
